package criptografia.imagem.impl;

/**
 *
 * @author Thy
 */
public class Main {

    public static void main(String[] args) {
        String s = "";
        System.out.println(s.length() - 92);

        int count = 0;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);

            if (c == 'Z') {
                count++;
            }

        }

        System.out.println(count);

    }
}
